import React, { useCallback } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { countPlusAction, countMinusAction } from '../redux/reducers/count';
import Layout from '../components/Layout';

const App = () => {
  const count = useSelector((state) => state.count);
  const dispatch = useDispatch();
  console.log(count);
  const minus = () => {
    dispatch(countMinusAction());
  };
  const plus = () => {
    dispatch(countPlusAction());
  };
  return (
    <Layout>
      <form>
        <table border="1">
          <tr>
            <td>대여일자</td>
            <td>날짜 ~ 날짜</td>
            <td>|</td>
            <td>검색항목</td>
            <td>차량번호input</td>
            <td>검색어 입력 input</td>
            <td>검사</td>
          </tr>
          <tr>
            <td>1</td>
            <td>2</td>
            <td>4</td>
            <td>5</td>
            <td>6</td>
            <td>7</td>
          </tr>
          <tr>
            <td>1</td>
            <td>2</td>
            <td>4</td>
            <td>5</td>
            <td>6</td>
            <td>7</td>
          </tr>
        </table>
      </form>
      {count}
      <button type="button" onClick={minus}>-</button>
      <button type="button" onClick={plus}>+</button>
    </Layout>
  );
};

export default App;
